import React, { useEffect, useState } from 'react';
import { Transition } from '@headlessui/react';
import inicio from '../image/nuevoContacto.png';
import contactos from '../image/listarContacto.png';
import detalleContacto from '../image/detalleContacto.png'; 
import login from '../image/iniciarSesion.png'; 
import iniciarSesion from '../image/registro.png';

function ProyectoDetalle4({ seccionAnimacion }) {
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth < 768);
    };

    window.addEventListener('resize', handleResize);

    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  return (
    <Transition
      show={seccionAnimacion === 'Proyecto4'}
      enter="transition ease-out duration-500"
      enterFrom="opacity-0 transform translate-y-full"
      enterTo="opacity-100 transform translate-y-0"
      leave="transition ease-in duration-300"
      leaveFrom="opacity-100 transform translate-y-0"
      leaveTo="opacity-0 transform translate-y-full"
    >
      <div
        id="Proyecto4"
        className="h-screen w-full flex flex-col items-center justify-center bg-gradient-to-b from-green-200 to-teal-100 text-white"
        style={{ background: 'rgba(0, 0, 0, 0.9)', minHeight: isMobile ? '4000px' : '4500px' }}
      >
        <div className="max-w-4xl px-6 py-12 mt-14 text-center">
          <h1 className="text-4xl font-bold mb-8 md:inline-block md:border-b-4">Landing Page</h1>
          <p className="text-lg text-gray-200 mb-8">
            Esta es una landing page diseñada para atraer y captar clientes potenciales para un servicio o producto específico. La página está enfocada en ofrecer una primera impresión impactante, guiando a los usuarios a través de una experiencia visualmente atractiva y persuasiva.
          </p>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Diseño de la Página</h2>
            <p className="text-lg text-gray-200 mb-4">
              La landing page presenta un diseño limpio y profesional, con un enfoque en la usabilidad y la conversión. Se ha utilizado una paleta de colores moderna y atractiva para captar la atención de los visitantes.
            </p>
            <img src={inicio} alt="Diseño de la Página" className="mb-4 w-full" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Lista de Funcionalidades</h2>
            <p className="text-lg text-gray-200 mb-4">
              La landing page incluye características clave como un formulario de suscripción, botones de llamada a la acción (CTA) claros y secciones que destacan las características principales del producto o servicio.
            </p>
            <img src={contactos} alt="Lista de Funcionalidades" className="mb-4 w-full" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Sección de Detalles</h2>
            <p className="text-lg text-gray-200 mb-4">
              La sección de detalles ofrece información detallada sobre el producto o servicio, incluyendo imágenes, descripciones y beneficios clave para ayudar a los visitantes a tomar una decisión informada.
            </p>
            <img src={detalleContacto} alt="Sección de Detalles" className="mb-4 w-full" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Formulario de Registro</h2>
            <p className="text-lg text-gray-200 mb-4">
              Un formulario de registro simple y efectivo permite a los visitantes suscribirse a boletines, recibir ofertas especiales o solicitar más información.
            </p>
            <img src={iniciarSesion} alt="Formulario de Registro" className="mb-4 w-full" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Acceso de Usuario</h2>
            <p className="text-lg text-gray-200 mb-4">
              La página también incluye una sección para iniciar sesión, lo que permite a los usuarios registrados acceder a sus cuentas y gestionar sus suscripciones o pedidos.
            </p>
            <img src={login} alt="Acceso de Usuario" className="mb-4 w-full" />
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Características Técnicas</h2>
            <p className="text-lg text-gray-200 mb-4">
              La landing page está desarrollada utilizando tecnologías modernas y técnicas de diseño web responsive para garantizar una experiencia de usuario óptima en todos los dispositivos.
            </p>
          </section>

          <section className="mb-12">
            <h2 className="text-3xl font-semibold mb-4 md:inline-block md:border-b-4">Backend con Laravel</h2>
            <p className="text-lg text-gray-200 mb-4">
              La funcionalidad del backend está gestionada con Laravel, proporcionando una integración robusta y segura con la base de datos y la lógica de negocio de la aplicación.
            </p>
          </section>
        </div>
      </div>
    </Transition>
  );
}

export default ProyectoDetalle4;
